import {
  AppBar,
  Box,
  Typography,
  Toolbar,
  Button,
  IconButton,
} from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";

function HomePage() {
  return (
    <Box>
      <AppBar>
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="Menu"
            onClick={() => {
              alert("menu clicked");
            }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" color="inherit">
            Menu
          </Typography>
        </Toolbar>
      </AppBar>
    </Box>
  );
}

export default HomePage;
